import React, { useEffect, useReducer, useState } from "react";
import { UseFetch } from "./useFetch";
import { product_reducer } from "../useReducer/productreducer/productreducer";
import { form_reducer_default_value } from "../useReducer/form_reducer";


export default function CustomHooks() {
   
  const [data , setdata]=useState("")
  const [categories , setcategories]=useState("")
  const productData = UseFetch("https://fakestoreapi.com/products");
  const categoriesData = UseFetch("https://fakestoreapi.com/products/categories");

 

 useEffect(() => {
  setdata({product :productData})
  setcategories({categories :categoriesData})
  
}, [productData,categories]);


  return (
    <>
   
      <h1>Custom Hooks</h1>
    
      <div className="container-fluid ms-auto w-75">
            <h2>search</h2>
            <form>
             
                <div className="btn group">
               
                     {JSON.stringify(categories)}
               
                </div>
                  
              
            </form>
        <table className="table">
          <thead>
            <tr>
              <th>ID</th>
              <th>Title</th>
              <th>Price</th>
              <th>Description</th>
              <th>Category</th>
              <th>Image</th>
              <th>Rating</th>
            </tr>
          </thead>
          <tbody>
       {JSON.stringify(data)}
          </tbody>
        </table>
       
      
      </div>
    </>
  );
}
